import React from "react";
import "../components/sidebar.css"
import "../components/Sidebarrow"
import SideBarrow from "../components/Sidebarrow";
function sidebar(){
    return(
    <div className="sidebar">
      
      <SideBarrow Selected title="home" icon="fa-solid fa-house icon"/>      
      <SideBarrow  title="trending" icon="fa-solid fa-arrow-trend-up icon"/>       
      <SideBarrow title="subscription" icon="fa-solid fa-pizza-slice icon"/>      
      <hr></hr>      
      <SideBarrow title="library" icon="fa-sharp fa-solid fa-bookmark icon" />      
      <SideBarrow title="history" icon="fa-sharp fa-solid fa-star icon" />      
      <SideBarrow title="your_videos" icon="fa-sharp fa-solid fa-face-smile icon" />     
      <SideBarrow title="watch later" icon="fa-sharp fa-solid fa-pen-nib icon" />      
      <SideBarrow title="liked videos" icon="fa-sharp fa-solid fa-thumbs-up icon" />      
      <SideBarrow title="show more" icon="fa-sharp fa-solid fa-angles-right icon" />      
      <hr></hr>
    </div>
    )}
export default sidebar;
